import React from "react";

function Food({ favourite }){
  return(
  <h1>I like {favourite}</h1>
  );
}

function App() {
  return (
    <div>
      <h1>Hello!</h1>
      <Food favourite="kimchi" />
      <Food favourite="ramen" />
      <Food favourite="kimbab" />
      <Food favourite="chicken" />
    </div>
  );
}

export default App;
